import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
// import Pub from './server';
import fs from 'fs';

const content = fs.readFileSync('../not_keys.json');
const {public_key} = JSON.parse(content);
// import key from '../server';

// ReactDOM.render(<App key={key}/>, document.getElementById('root'));
ReactDOM.render(<App public_key={public_key} />, document.getElementById('root'));
